import React from 'react'

const Admin_view_users = () => {
  return (
    <div className='text-white'>
      <div className='max-w-[800px] mt-[96px] w-full mx-auto my-auto text-center flex flex-col'>
        <p className='text-green-500 font-bold p-2'>ONTOLOGY-BASED DIAGNOSTICS</p>

        <h1 className='md:text-7xl sm:text-6xl text-4xl font-bold md:py-6'>Using Unani medicine.</h1>

        <div className='flex justify-center py-4'>
          <p className='md:text-5xl sm:text-4xl text-xl font-bold'>A tool for</p>
          <Typed 
          className='md:text-5xl sm:text-4xl text-xl font-bold md:pl-4 pl-2'
          strings={['Symptom diagnosis', 'Rating diagnosis', 'Knowledge Management']}
          typeSpeed={90}
          backSpeed={60}
          loop
          />
        </div>
        </div>
        </div>
  )
}

export default Admin_view_users
